import{_ as e,o as i,c as t,O as a}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 54.1-703.3 Waiver of examination; estheticians.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-703.3.md","filePath":"vacode/54.1-703.3.md"}'),r={name:"vacode/54.1-703.3.md"},o=a('<h1 id="§-54-1-703-3-waiver-of-examination-estheticians" tabindex="-1">§ 54.1-703.3 Waiver of examination; estheticians. <a class="header-anchor" href="#§-54-1-703-3-waiver-of-examination-estheticians" aria-label="Permalink to &quot;§ 54.1-703.3 Waiver of examination; estheticians.&quot;">​</a></h1><p>The Board shall waive the examination requirements for licensure as an esthetician or master esthetician for any individual who (i) makes application for licensure by July 31, 2009; (ii) otherwise complies with Board regulations relating to moral turpitude; and (iii) meets any of the following conditions:</p><ol><li><p>Has at least three years of documented work experience as an esthetician or a master esthetician completed prior to July 1, 2008, that is deemed satisfactory by the Board;</p></li><li><p>Has completed a training program prior to July 1, 2008, that is deemed satisfactory by the Board; or</p></li><li><p>Holds an unexpired certificate of registration, certification, or license as an esthetician or a master esthetician issued to him prior to July 1, 2008, on the basis of comparable requirements by a proper authority of a state, territory, or possession of the United States, or the District of Columbia.</p></li></ol><p>2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0829" target="_blank" rel="noreferrer">829</a>; 2009, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0166" target="_blank" rel="noreferrer">166</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0328" target="_blank" rel="noreferrer">328</a>.</p>',4),n=[o];function s(c,l,h,p,d,f){return i(),t("div",null,n)}const u=e(r,[["render",s]]);export{_ as __pageData,u as default};
